import React from 'react'
import auth from '../SignIn/auth'

export default function Devices(props) {
    return (
        <div>
            <h1>Protected page</h1>

            <button onClick={() => {
                auth.logout(() => {
                    props.history.push('/')
                })
            }}>logout </button>
        </div>
    )
}
